--CREATE DATABASE MP4
USE MP4
GO
CREATE TABLE Banda(
cod_banda INT PRIMARY KEY,
nome_banda VARCHAR(50),
nacionalidade_banda VARCHAR(50),
data_fundacao_banda DATE,
)

CREATE TABLE Artista(
cod_artista INT PRIMARY KEY,
nome_artista VARCHAR(50),
nacionalidade VARCHAR(50),
data_nascimento DATE,
sexo VARCHAR (10),
cod_banda INT
        FOREIGN KEY(cod_banda)
        REFERENCES Banda(cod_banda)
)

CREATE TABLE Album(
cod_album INT PRIMARY KEY,
nome_album VARCHAR(50),
género VARCHAR(50),
ano_lançamento SMALLINT,
CHECK(ano_lançamento >= 0),
)

CREATE TABLE Faixa(
cod_faixa INT PRIMARY KEY,
nome_faixa VARCHAR(50),
nacionalidade_faixa VARCHAR(50),
duracao_faixa FLOAT,
classificação_faixa TINYINT,
CHECK (classificação_faixa BETWEEN 0 AND 10),
letra_faixa TEXT,
cod_album INT
    FOREIGN KEY(cod_album)
    REFERENCES Album(cod_album),
)

CREATE TABLE Compositor(
cod_compositor INT PRIMARY KEY,
nome_compositor VARCHAR(50)
)

CREATE TABLE ListaFaixas(
cod_lista INT PRIMARY KEY,
nome_lista VARCHAR(50),    
)

CREATE TABLE Artista_Faixa(
cod_artista INT
    FOREIGN KEY(cod_artista)
    REFERENCES Artista(cod_artista),
cod_faixa INT
    FOREIGN KEY(cod_faixa)
    REFERENCES Faixa(cod_faixa),

PRIMARY KEY(cod_artista, cod_faixa)
)

CREATE TABLE Faixa_ListaFaixas(
cod_faixa INT
    FOREIGN KEY(cod_faixa)
    REFERENCES Faixa(cod_faixa),
cod_lista INT
    FOREIGN KEY(cod_lista)
    REFERENCES ListaFaixas(cod_lista),

PRIMARY KEY(cod_faixa, cod_lista)
)

CREATE TABLE Faixa_Compositor(
cod_faixa INT
    FOREIGN KEY(cod_faixa)
    REFERENCES Faixa(cod_faixa),
cod_compositor INT
    FOREIGN KEY(cod_compositor)
    REFERENCES Compositor(cod_compositor),

PRIMARY KEY(cod_faixa, cod_compositor)
)

CREATE TABLE Género(
cod_genero INT PRIMARY KEY,
nome_genero VARCHAR(50) 
)

CREATE TABLE Faixa_Género(
cod_faixa INT
    FOREIGN KEY(cod_faixa)
    REFERENCES Faixa(cod_faixa),
cod_genero INT
    FOREIGN KEY(cod_genero)
    REFERENCES Género(cod_genero)

PRIMARY KEY(cod_faixa, cod_genero)
)

CREATE TABLE Instrumento(
cod_instrumento INT PRIMARY KEY,
nome_instrumento VARCHAR(50)
)

CREATE TABLE Artista_Instrumento(
cod_artista INT
    FOREIGN KEY(cod_artista)
    REFERENCES Artista(cod_artista),
cod_instrumento INT
    FOREIGN KEY(cod_instrumento)
    REFERENCES Instrumento(cod_instrumento),

PRIMARY KEY(cod_artista, cod_instrumento)
)


