--CONSULTAS SQL

--Visualizar toda a informação da tabela Banda:
SELECT *
FROM Banda

--Visualizar colunas específicas da tabela Album:
SELECT nome_album, ano_lançamento 
FROM Album

--Visualizar os compositores existentes:
SELECT nome_compositor AS "Compositores" 
FROM Compositor

--Visualizar as faixas e albuns correspondentes:
SELECT nome_faixa, nome_album
FROM Faixa INNER JOIN Album ON Faixa.cod_faixa = Album.cod_album

--Visualizar os nomes dos 3 primeiros artistas existentes:
SELECT TOP (3) Artista.nome_artista
FROM Artista

--Saber quantas bandas existem:
SELECT Count(*) AS "Número de bandas"
FROM Banda

--Visualizar o nome e a data de nascimento de todos os Artistas, do mais velho para o mais novo:
SELECT nome_artista, data_nascimento
FROM Artista
ORDER BY data_nascimento ASC

--Visualizar informação sobre a faixa 7:
SELECT*
FROM Faixa
WHERE cod_faixa = 7

--Visualizar informação sobre as faixas 4-7:
SELECT*
FROM Faixa
WHERE cod_faixa BETWEEN 4 AND 7

--Visualizar todos os albúns cujo nome começa por P:
SELECT nome_album AS "Nome Album"
FROM Album
WHERE upper(nome_album) LIKE 'P%'

--Visualizar todos os artistas que não tenham a letra “u” no nome, ordenados por código:
SELECT nome_artista AS "Nome Artista"
FROM Artista
WHERE (nome_artista) NOT LIKE '%u%'
ORDER BY cod_artista

--Visualizar os nomes e duração das faixas, da mais longa para a mais curta:
SELECT nome_faixa "Nome", duracao_faixa "Duração (min)"
FROM Faixa
ORDER BY duracao_faixa DESC

--Visualizar quantos géneros diferentes existem
SELECT COUNT(DISTINCT nome_genero)
FROM Género

--Visualizar quantas artistas existem
SELECT COUNT(sexo) AS "Artistas femininas"
From Artista
WHERE upper(sexo) = 'Female'

--Visualizar o número de artistas por sexo:
SELECT sexo AS "Sexo", COUNT(*) AS "Nº"
FROM Artista
GROUP BY sexo

--Visualizar quantas faixas do album 8 existem por nome:
SELECT UPPER(nome_faixa) "Nome", COUNT(*) "Nº Faixas"
FROM Faixa
WHERE cod_album = 8 AND nome_faixa IS NOT NULL
GROUP BY UPPER(nome_faixa) 

-- Visualizar as faixas com classificação maior que a faixa nº 30, ordenadas por código::
SELECT nome_faixa, AVG(classificação_faixa) AS "Classificação"
FROM Faixa
GROUP BY nome_faixa
HAVING AVG(classificação_faixa) > (SELECT
AVG(classificação_faixa)
FROM Faixa
WHERE cod_faixa = 30)

-- Visualizar o número de albuns que existem por ano de lançamento
SELECT ano_lançamento "Ano de lançamento", COUNT(*) "Quantidade"
FROM Album
WHERE ano_lançamento IS NOT NULL
GROUP BY ano_lançamento

--Visualizar os artistas com as respetivas bandas:
SELECT Artista.nome_artista, Banda.nome_banda
FROM Banda INNER JOIN Artista ON Banda.cod_banda = Artista.cod_artista

--Qual a banda com maior número de artistas?
SELECT Banda.nome_banda, COUNT(Banda.nome_banda) AS "Nº Elementos"
FROM Banda INNER JOIN Artista ON Banda.cod_banda = Artista.cod_artista
GROUP BY Banda.nome_banda 
ORDER BY "Nº Elementos" DESC

-- Visualizar todos os artistas e as suas respetivas nacionalidades ordenado por nome:
SELECT Artista.nacionalidade "nacionalidade", Artista.nome_artista "nome"
From Artista
ORDER BY Artista.nome_artista ASC

--Quais as faixas que estão na lista "Bitwolf"
SELECT Faixa.nome_faixa
FROM Faixa INNER JOIN (Faixa_ListaFaixas INNER JOIN ListaFaixas ON ListaFaixas.cod_lista = Faixa_ListaFaixas.cod_lista)ON Faixa.cod_faixa =Faixa_ListaFaixas.cod_faixa
WHERE (((ListaFaixas.nome_lista) = 'Bitwolf'))--176

--Visualizar qual a banda a qual o artista Doy Cullen pertence:
SELECT nome_artista, nome_banda
FROM Artista INNER JOIN Banda on Artista.cod_banda = Banda.cod_banda
WHERE nome_artista = 'Doy Cullen' --Fairy penguin

--Saber quais os artistas a solo (que não possuem banda) existentes
SELECT nome_artista AS "Artistas a solo"
From Artista
WHERE cod_banda IS NULL

--Visualizar quantos compositores possuem se chamam Lukas:
SELECT Count(Compositor.nome_compositor) AS "Lukas" 
FROM Compositor
WHERE Compositor.nome_compositor LIKE 'Lukas%'

--Visualizar nome da musica, artista e compositor/varias interpertações da mesma música
SELECT nome_faixa "Nome da musica", nome_artista "Nome Artista",nome_compositor "Nome compositor"
FROM (((Artista INNER JOIN (Faixa INNER JOIN Artista_Faixa ON Artista_Faixa.cod_faixa = Faixa.cod_faixa) ON Artista.cod_artista=Artista_faixa.cod_artista) INNER JOIN Faixa_Compositor ON Faixa_Compositor.cod_faixa= Faixa.cod_faixa) INNER JOIN Compositor ON Faixa_Compositor.cod_compositor= Compositor.cod_compositor)
WHERE nome_faixa = 'Santa Fe' 

--Todas as músicas rock da base de dados com acompanhamento de violino e nome do violinista
SELECT Faixa.nome_faixa "nome",nome_artista "artista"
FROM Género INNER JOIN (Faixa_Género INNER JOIN (Faixa INNER JOIN(Artista_Faixa INNER JOIN (Artista INNER JOIN(Artista_Instrumento INNER JOIN Instrumento ON Artista_Instrumento.cod_instrumento=Instrumento.cod_instrumento) ON Artista_Instrumento.cod_artista =Artista.cod_artista) ON Artista_Faixa.cod_artista=Artista.cod_artista) ON Faixa.cod_faixa= Artista_Faixa.cod_faixa) ON Faixa_Género.cod_faixa= Faixa.cod_faixa) ON Género.cod_genero= Faixa_Género.cod_genero
WHERE ((Género.nome_genero= 'rock') AND (Instrumento.nome_instrumento= 'violino'))

--Todas as músicas de rap e artistas que fazem rap
SELECT Faixa.nome_faixa "nome",nome_artista "artista"
FROM Género INNER JOIN (Faixa_Género INNER JOIN (Faixa INNER JOIN(Artista_Faixa INNER JOIN Artista ON Artista_Faixa.cod_artista=Artista.cod_artista) ON Faixa.cod_faixa= Artista_Faixa.cod_faixa) ON Faixa_Género.cod_faixa= Faixa.cod_faixa) ON Género.cod_genero= Faixa_Género.cod_genero
WHERE (Género.nome_genero= 'rap')